import React from 'react'

const SoundSlider = () => {
  return (
    <div className='slider-cont'>
        <div className="slider">
            <input type="range" min="0" max="0" value="50"/>
            <progress min="0" max="100" value="50"></progress>
        </div>
    </div>

  )
}

export default SoundSlider
